import React from "react";
import { Route } from "react-router-dom";
import Homepage from "./Pages/homepage/Homepage";

import "./App.css";

function App() {
  return (
    <div className="App">
      <Route exact />
      <Homepage />
    </div>
  );
}

export default App;
